```python
def check_inclusion(s1, s2):
    def is_permutation(str1, str2):
        return sorted(str1) == sorted(str2)

    def find_inclusion(s1, s2, index):
        if index == len(s2):
            return False
        if is_permutation(s1, s2[index:index+len(s1)]):
            return True
        return find_inclusion(s1, s2, index+1)

    return find_inclusion(s1, s2, 0)
```

Trong mã trên, hàm `is_permutation` được sử dụng để kiểm tra xem hai chuỗi có phải là hoán vị của nhau hay không. Hàm `find_inclusion` được sử dụng để tìm chuỗi `s1` trong chuỗi `s2`. Nếu `s1` nằm trong `s2`, hàm trả về `True`. Nếu `s1` không nằm trong `s2`, hàm trả về `False`.

